      {"cfe888e0-83a6-4e15-8b71-6326dd9904de":{"version":"3.4.1","title":"Bokeh Application","roots":[{"type":"object","name":"Tabs","id":"p1496","attributes":{"sizing_mode":"stretch_both","tabs":[{"type":"object","name":"TabPanel","id":"p1487","attributes":{"title":"Summary","child":{"type":"object","name":"Div","id":"p1486","attributes":{"styles":{"type":"map","entries":[["width","100%"],["height","100%"],["max-width","1920px"],["max-height","1080px"],["padding","12px"],["border","1px solid lightgray"],["box-shadow","inset 1px 0 8px 0 lightgray"],["overflow","auto"]]},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 14m 38s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 42 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 12m 57s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:43505 &lt;/li&gt;\n          &lt;li&gt; Workers: 48 &lt;/li&gt;\n          &lt;li&gt; Threads: 48 &lt;/li&gt;\n          &lt;li&gt; Memory: 187.47 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2024.6.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2024.6.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n#!/usr/bin/env python\nfrom __future__ import print_function, division\nimport numpy as np\nimport MDAnalysis as mda\nfrom MDAnalysis import Universe, Writer\nfrom MDAnalysis.analysis.align import rotation_matrix\nfrom MDAnalysis.lib.qcprot import CalcRMSDRotationalMatrix\nimport dask\nfrom dask.distributed import Client, performance_report\nfrom dask.delayed import delayed\nfrom dask import multiprocessing\nfrom dask.multiprocessing import get\nimport time\nimport multiprocessing\nfrom shutil import copyfile\nimport pickle\nimport sys\nimport warnings\nfrom Bio import BiopythonDeprecationWarning\nfrom proxystore.connectors.file import FileConnector\nfrom proxystore.store import Store\nimport os\n\ndef pickle_size(obj):\n    return sys.getsizeof(pickle.dumps(obj))\n\ndef rmsd(mobile, xref0):\n    xmobile0 = mobile.positions - mobile.center_of_mass()\n    return CalcRMSDRotationalMatrix(xref0.T.astype(np.float64), xmobile0.T.astype(np.float64), mobile.n_atoms, None, None)\n\ndef block_rmsd(ag, ref0, start=None, stop=None, step=None):\n    u = ag.universe\n    xref0 = ref0.positions - ref0.center_of_mass()\n\n    clone = mda.Universe(u._topology, u.trajectory.filename, **u.kwargs)\n    g = clone.atoms[ag.indices]\n    assert u != clone\n\n    bsize = stop - start\n    results = np.zeros([bsize, 2])\n    t_comp = np.zeros(bsize)\n\n    start1 = time.time()\n    for iframe, ts in enumerate(clone.trajectory[start:stop:step]):\n        start2 = time.time()\n        results[iframe, :] = ts.time, rmsd(g, xref0)\n        t_comp[iframe] = time.time() - start2\n\n    t_all_frame = time.time() - start1\n    t_comp_final = np.mean(t_comp)\n\n    return results, t_comp_final, t_all_frame, pickle_size(results)\n\ndef com_parallel_dask(ag, n_blocks, client, store):\n    ref0 = ag.universe.select_atoms(\"protein\")\n    bsize = int(np.ceil(ag.universe.trajectory.n_frames / float(n_blocks)))\n\n    blocks = []\n    block_input_size = pickle_size((ag, ref0, 0, bsize, 1))\n    for iblock in range(n_blocks):\n        start, stop, step = iblock * bsize, (iblock + 1) * bsize, 1\n        block_input = (ag, ref0, start, stop, step)\n        block_input_proxy = store.proxy(block_input)\n        out = delayed(block_rmsd)(block_input_proxy[0], block_input_proxy[1], start=block_input_proxy[2], stop=block_input_proxy[3], step=block_input_proxy[4])\n        blocks.append(out)\n\n    output = client.compute(blocks, sync=True)\n\n    # Proxy the results\n    results = np.vstack([out[0] for out in output])\n    results_proxy = store.proxy(results)\n    t_comp_avg = np.mean([out[1] for out in output])\n    t_comp_max = np.max([out[1] for out in output])\n    t_all_frame_avg = np.mean([out[2] for out in output])\n    t_all_frame_max = np.max([out[2] for out in output])\n    pickle_sizes = [out[3] for out in output]\n\n    return results_proxy, t_comp_avg, t_comp_max, t_all_frame_avg, t_all_frame_max, pickle_sizes, block_input_size\n\nif __name__ == \"__main__\":\n    PSF, DCD1 = [\"adk4AKE.psf\", \"1ake_007-nowater-core-dt240ps.dcd\"]\n\n    num_cores = multiprocessing.cpu_count()\n    client = Client(n_workers=num_cores)\n    dask.config.set(scheduler='distributed')\n\n    with Store(\n        name='dask',\n        connector=FileConnector('/tmp/proxystore-cache'),\n        populate_target=True,\n        register=True,\n    ) as store:\n\n        with open('data.txt', mode='w') as file:\n            traj_size = [25, 50, 100]  # Smaller trajectory sizes for testing\n            with performance_report(filename=\"report.html\"):\n                for k in traj_size:\n                    # Creating the universe for doing benchmark\n                    u1 = mda.Universe(PSF, DCD1)\n                    longDCD = 'newtraj.dcd'\n\n                    # Creating big trajectory sizes from initial trajectory (DCD file)\n                    with mda.Writer(longDCD, u1.atoms.n_atoms) as W:\n                        for i in range(k):\n                            for ts in u1.trajectory:\n                                W.write(u1)\n                    u = mda.Universe(PSF, longDCD)\n\n                    # Doing benchmarks\n                    ii = 2\n                    block_size = [1, 2, 4]  # Optional: Smaller block sizes for testing\n                    for i in block_size:  # changing blocks\n                        for j in range(1, 3):  # fewer iterations per block size for testing\n                            longDCD1 = 'newtraj{}.dcd'.format(ii)\n                            copyfile(longDCD, longDCD1)\n                            u = mda.Universe(PSF, longDCD1)\n                            print(u)\n                            print(\"frames in trajectory {} for traj_size {}\".format(u.trajectory.n_frames, k))\n                            print(len(u.trajectory))\n                            mobile = u.select_atoms(\"(resid 1:29 or resid 60:121 or resid 160:214) and name CA\")\n\n                            start = time.time()\n                            results_proxy, t_comp_avg, t_comp_max, t_all_frame_avg, t_all_frame_max, pickle_sizes, block_input_size = com_parallel_dask(mobile, i, client, store)\n                            tot_time = time.time() - start\n\n                            file.write(\"XTC{} {} {} {} {} {} {} {} {} {}\\n\".format(k, i, j, t_comp_avg, t_comp_max, t_all_frame_avg, t_all_frame_max, tot_time, str(pickle_sizes), block_input_size))\n                            file.flush()\n                            os.remove('newtraj{}.dcd'.format(ii))\n                            ii = ii + 1\n    client.close()\n\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p1491","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p1135","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p1133","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p1134","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p1145"},"y_scale":{"type":"object","name":"LinearScale","id":"p1146"},"title":{"type":"object","name":"Title","id":"p1138","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p1175","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p1130","attributes":{"selected":{"type":"object","name":"Selection","id":"p1131","attributes":{"indices":[],"line_indices":[]}},"
